import React from 'react';

function Dashboard() {
    return (
        <div className="dashboard-container">
            <h1 className="dashboard-title">Bem-vindo à Pizzaria do JayJay</h1>
            <div className="button-container">
                <button className="dashboard-button">Opção 1</button>
                <button className="dashboard-button">Opção 2</button>
                <button className="dashboard-button">Opção 3</button>
                <button className="dashboard-button">Opção 4</button>
                <button className="dashboard-button">Opção 5</button>
            </div>
        </div>
    );
}

export default Dashboard;
